import React from 'react';
import "./Home.css";

function Home() {
  
  var token = localStorage.getItem('token');
  var pp = localStorage.getItem('profilephoto');
 
  return (
    <div className="container home" style={{marginBottom:"100px",border:"1px solid #84c225"}}>
        <div className="row">
            <div className="col-md-12 productbox"  style={{paddingTop:"10px"}}>
             
             <div className=" p-3 " style={{borderRadius:"10px",boxShadow:"0 0 10px gray"}}>
              <div className="text-center mb-3" style={{borderRadius:"10px",boxShadow:"0 0 5px gray"}}>
                <img height={150} width={150} />
              </div>
              <div className="">
              <p style={{fontWeight:"bold"}}>CINTHOL -Cool soap</p>
              <p className="alert alert-secondary"></p>
              <div style={{display:"flex"}}>
              <p style={{marginRight:"5px"}}>Rs</p><p style={{fontWeight:"bold"}}>100</p> </div>
              </div>
              <div className="bg-danger">
              <div className="btn btn-danger p-0">
              <button type="button" >-</button>
              <input type="number" step="1" min="1" max="" name="quantity" value="1" title="Qty" size="4"/>
              <button type="button" >+</button>
              </div>
              </div>
             </div>

            
            </div>
        </div>   

    </div>
  );
}

export default Home;
